bool drop_tile(int board[][10]) {
    bool done = true;
    for (int x = 1; x < 9; x++) {
        int found = -1;
        //looking for gaps in board
        for (int y = 1; y < 9; y++) { //1-8 -> 0-7
            if (board[x][y] == 5) {
                found = y;
            }
        }
        if (found >= 0) {
            done = false;
            //takes the gap and swaps it into the buffer
            for (int y = found; y > 0; y--) { //for n tiles, we need to swap n-1 times. But also need to swap with buffer so n times.
                int temp = board[x][y];
                board[x][y] = board[x][y - 1];
                board[x][y - 1] = temp;
            }
        }
        //moves blank space into buffer
    }
    return done;
}

void stock_buffer(int board[][10]) {
    int last_buffer = -1;
    int value = 0;
    for (int i = 1; i < 9; i++) {
        if (!(board[i][0] >= 0 && board[i][0] <= 4)) {
            do {
                value = rand() % 5;
            } while (value == last_buffer);
            board[i][0] = value;
            last_buffer = value;
        }
    }
}

