void swap_animation(int sprite1, int x1, int y1, int sprite2, int x2, int y2, int speed) {
    if (x1 == x2 && y1 == y2) {
        return;
    } else
        if (x1 == x2) { //same column
        int x_const = 80 + x1 * 20;
        int top_y = 0;
        int top_sprite = 0;
        int bot_y = 0;
        int bot_sprite = 0;
        if (y2 > y1) {
            top_y = 40 + y1 * 20; //y2 > y1
            top_sprite = sprite1; //sprite 1 is higher than sprite 2
            bot_y = 40 + y2 * 20;
            bot_sprite = sprite2;
        } else
            if (y1 > y2) {
            top_y = 40 + y2 * 20; //y1 > y2
            top_sprite = sprite2; //sprite 2 is higher than sprite 1
            bot_y = 40 + y1 * 20;
            bot_sprite = sprite1;

        }
        for (int i = 1; i <= 20 / speed; i++) {
            draw_sprite(tile, x1, y1);
            draw_sprite(tile, x2, y2);
            draw_board_tile_pixel(top_sprite, x_const, top_y + i * speed); //to move it down we need to add y
            draw_board_tile_pixel(bot_sprite, x_const, bot_y - i * speed); //to move it up we need to subtract y
            wait_for_vsync();
        }
    } else
        if (y1 == y2) { //same row
        int y_const = 40 + y1 * 20;
        int left_x = 0;
        int left_sprite = 0;
        int right_x = 0;
        int right_sprite = 0;
        if (x2 > x1) {
            left_x = 80 + x1 * 20;
            left_sprite = sprite1;
            right_x = 80 + x2 * 20;
            right_sprite = sprite2;
        } else
            if (x1 > x2) {
            left_x = 80 + x2 * 20;
            left_sprite = sprite2;
            right_x = 80 + x1 * 20;
            right_sprite = sprite1;
        }
        for (int i = 1; i <= 20 / speed; i++) {
            draw_sprite(tile, x1, y1);
            draw_sprite(tile, x2, y2);
            draw_board_tile_pixel(left_sprite, left_x + i * speed, y_const); //to move it right we need to add x
            draw_board_tile_pixel(right_sprite, right_x - i * speed, y_const); //to move it left we need to sub x
            wait_for_vsync();
        }
    }
}
